
exports.Response = Response;

function Response(action, data) {
    console.log(action);
    data = data || {};
    data.action = action;
    this.data = data;
    console.log(this.data);
}

Response.prototype.getData = function() {
    return this.data;
};

exports.InvalidResponse = InvalidResponse;

function InvalidResponse(action) {
    console.log(action);
    Response.call(this, action, {});
}
InvalidResponse.super_ = Response;
InvalidResponse.prototype = Object.create(Response.prototype, {
    constructor: {
        value: Response,
        enumerable: false
    }
});

